  <script>

    var html = document.documentElement,
      body = document.body;

    (function () {
      var ua = navigator.userAgent, tem,
        M = ua.match(/(opera|chrome|safari|firefox|msie|trident(?=\/))\/?\s*(\d+)/i) || [];
      if (/trident/i.test(M[1])) {
        tem = /\brv[ :]+(\d+)/g.exec(ua) || [];
        console.log("Explorer - " + tem)
        if (tem[1] < 10) {
          console.log("Explorer Inner 1- ")
          document.getElementById("homeLogoLink").href = "https://" + window.location.hostname.split('.')[0] + ".MyPerfectResume" + ".com"

          document.getElementById("upgradebrowser").className = document.getElementById("upgradebrowser").className.replace("d-none", "");
          document.getElementById("howItWorks").className = document.getElementById("howItWorks").className.replace("d-none", "");
          document.getElementById("contentHowItWorks").className = document.getElementById("contentHowItWorks").className + " d-none";
          document.documentElement.className = document.documentElement.className + ' upgrade-browser';

          if ("mpr" == "lca") {
            window.RDL.LowerVersionBroswer = true;
          }
        }
      }
      if (M[1] === 'Chrome') {
        tem = ua.match(/\b(OPR|Edge)\/(\d+)/);
        if (tem != null) return tem.slice(1).join(' ').replace('OPR', 'Opera');
      }
      M = M[2] ? [M[1], M[2]] : [navigator.appName, navigator.appVersion, '-?'];

      if ((tem = ua.match(/version\/(\d+)/i)) != null) M.splice(1, 1, tem[1]);
      if (((M[0] === "IE" || M[0] === "MSIE") && M[1] < 10) || (M[0] === "Safari" && M[1] < 7)) {
        document.getElementById("homeLogoLink").href = "https://" + window.location.hostname.split('.')[0] + ".MyPerfectResume" + ".com"

        document.getElementById("upgradebrowser").className = document.getElementById("upgradebrowser").className.replace("d-none", "");
        document.getElementById("howItWorks").className = document.getElementById("howItWorks").className.replace("d-none", "");
        document.getElementById("contentHowItWorks").className = document.getElementById("contentHowItWorks").className + " d-none";

        if ("mpr" == "lca") {
          window.RDL.LowerVersionBroswer = true;
        }
      }

      function isIE11() {
        if ((ua.toLowerCase().indexOf('trident') > -1) && (ua.match(/11.0/i))) return true;
        else return false;
      }
      if (isIE11()) {
        html.classList.add('ie11');
      }
    })();
