    function GetABTestCaseIndex(experimentId) {
      var rtnObj = { isNeedToConduct: true, caseIndex: 0 }

      if (experimentId == undefined || experimentId == null || experimentId == "") {
        rtnObj.isNeedToConduct = false;
        return rtnObj;
      }

      var disableAbTest = { frmQS: GetQueryString('disabletests'), frmCookie: ReadCookie('disabletests') };
      var runAbTests = { frmQS: GetQueryString('runtest'), frmCookie: ReadCookie('runtest') };
      var abTestsValue = runAbTests.frmQS;

      if ((abTestsValue == null || abTestsValue == undefined) && !!runAbTests.frmCookie) {
        // means value is in cookie
        abTestsValue = runAbTests.frmCookie;
      }

      if (!!abTestsValue) {
        var multiAbtests = abTestsValue.split(',');
        if (multiAbtests && multiAbtests.length > 0) {
          var selectedAbtest = null;
          for (var i = 0; i < multiAbtests.length; i++) {
            if (multiAbtests[i].toLowerCase().indexOf(experimentId.toLowerCase()) > -1) {
              selectedAbtest = multiAbtests[i];
              break;
            }
          }
          if (selectedAbtest) {
            //return its case index
            var keyIndexPair = selectedAbtest.split('_');
            if (keyIndexPair && keyIndexPair.length == 2) {
              rtnObj.isNeedToConduct = false;
              rtnObj.caseIndex = parseInt(keyIndexPair[1]);
              return rtnObj;
            }
          }
        }
      }

      var IsDisableTest = disableAbTest.frmQS;
      if ((IsDisableTest == null || IsDisableTest == undefined) && (disableAbTest.frmCookie != null && disableAbTest.frmCookie != undefined)) {
        // means value is in cookie
        IsDisableTest = disableAbTest.frmCookie;
      }

      if (IsDisableTest != null && IsDisableTest != undefined && IsDisableTest == "1") {
        rtnObj.isNeedToConduct = false;
        rtnObj.caseIndex = 0;
        return rtnObj;
      }
      return rtnObj;
    }

